import React from "react";
import Header from "./components/header/Header";
import Footer from "./components/footer/Footer";

type ParentProps = {
    children: React.ReactNode;
};

const Parent: React.FC<ParentProps> = ({ children }) => {
  return (
    <>
      <Header />
      {children}
      <Footer />
    </>
  );
};

export default Parent;
